import { Component } from 'react';
import LoginForm from '../Components/LoginForm';
import '../bulma.min.css';
import '../login.css';

class Login extends Component {
  render() {
    return (
      <LoginForm />
    );
  }
}

const mapStateToProps = (state) => ({
  login: state.user,
});

export default Login;
